<script>
  import SvgPanZoom from 'vue-svg-pan-zoom'; 
  export default {
    components :{SvgPanZoom},
    data() {
      return {
        nbMap: 0,
        title: '',
        region: '',
        bleu: 'hsl(202, 87%, 58%)',
        montagne: '#565656',
        contour: '#fff',
        newStock: 'B7B8C4',
        map: [],
        information: '',
        isShowModal: false,
        nbTerritoireRohan: 0,
        nbTerritoireElfe: 0,
        nbTerritoireGondor: 0,
        nbTerritoireNain: 0,
        nbTerritoireMordor: 0,
        nbTerritoireIsengard: 0,
        nbTerritoireGobelin: 0,
        nbTerritoireAngmar: 0,

        nbPlayerRohan: 0,
        nbPlayerElfe: 0,
        nbPlayerGondor: 0,
        nbPlayerNain: 0,
        nbPlayerMordor: 0,
        nbPlayerIsengard: 0,
        nbPlayerGobelin: 0,
        nbPlayerAngmar: 0,

        nbPlayers: 0,

        chef: [],
        faction: null,
        loading: false

      }
    },
    methods: {
      getInfo(e) {
        console.log(e.target.id);
        this.title = e.target.id;
        this.region = e.target.getAttribute("aria-valuetext");
      },
      toggleModal() {
        this.isShowModal = !this.isShowModal;
      }
    },
    async fetch() {
      this.loading = true;
      this.map = await this.$http.$get('https://api.npoint.io/38a2899b98818d89418c');
      this.chef = await this.$http.$get('https://api.npoint.io/38a2899b98818d89418c/chefdefaction'); //API
      this.faction = await this.$http.$get('https://api.npoint.io/38a2899b98818d89418c/factions'); //API
      this.loading = false;
      //   this.map = await this.$http.$get('https://api.npoint.io/a982d740a3c6fa4e6847'); //API
      //   this.chef = await this.$http.$get('https://api.npoint.io/a982d740a3c6fa4e6847/chefdefaction'); //API

      for (var key in this.map) {
        if (!this.map.hasOwnProperty(key)) continue;

        var obj = this.map[key];


        for (var prop in obj) {
          if (!obj.hasOwnProperty(prop)) continue;

          switch (obj[prop]) {
            case '#0bff00':
            case '#0BFF00':
              this.nbTerritoireRohan += 1;
              break;

            case '#00bfff':
            case '#00BFFF':
              this.nbTerritoireElfe += 1;
              break;

            case '#1e90ff':
            case '#1E90FF':
              this.nbTerritoireGondor += 1;
              break;

            case '#fffc00':
            case '#FFFC00':
              this.nbTerritoireNain += 1;
              break;

            case '#db5461':
            case '#DB5461':
              this.nbTerritoireMordor += 1;
              break;

            case '#ffffff':
            case '#FFFFFF':
              this.nbTerritoireIsengard += 1;
              break;

            case '#ff6f00':
            case '#FF6F00':
              this.nbTerritoireGobelin += 1;
              break;

            case '#c500ff':
            case '#C500FF':
              this.nbTerritoireAngmar += 1;
              break;
            default:
              break;
          }
        }

        if (!obj['players'].length > 0) continue;
        let obj2 = JSON.parse(JSON.stringify(obj['players']))
        for (var player in obj2) {

          switch (obj2[player]['faction']) {
            case 1:
              this.nbPlayerRohan += 1;
              this.nbPlayers += 1;
              break;
            case 2:
              this.nbPlayerElfe += 1
              this.nbPlayers += 1;
              break;
            case 3:
              this.nbPlayerGondor += 1
              this.nbPlayers += 1;
              break;
            case 4:
              this.nbPlayerNain += 1
              this.nbPlayers += 1;
              break;
            case 5:
              this.nbPlayerMordor += 1
              this.nbPlayers += 1;
              break;
            case 6:
              this.nbPlayerIsengard += 1
              this.nbPlayers += 1;
              break;
            case 7:
              this.nbPlayerGobelin += 1
              this.nbPlayers += 1;
              break;
            case 8:
              this.nbPlayerAngmar += 1
              this.nbPlayers += 1;
              break;
            default:
              break;
          }
        }
      }
    },
    filters: {
    pourcentage: function(valeur, decimales) {
      if(decimales === undefined) {
        decimales = 2;
      }
      if (valeur === 0) {
        return "";
      }
      return Math.round(valeur * Math.pow(10, decimales)) / Math.pow(10, decimales) + ' %';
    }
  }
  }

</script>
